function Product({ item }) {
  // const images = item.map(({ images }) => images);

  return (
    <div>
      <img
        key={item.id}
        className="medium"
        src={item.images["front"]}
        alt={item.item_name}
      />
      <h4>{item.item_name}</h4>
      <div>${item.price}</div>
      <div>
        <button>add to cart</button>
      </div>
    </div>
  );
}
export default Product;
